import React from "react";
import "../Style/Footer.css";
const Footer = (HomeImg)=>{
    const {Logo} = HomeImg;
    return(
        <React.Fragment>
            <footer>
                <div className="FooterOne">
                    <img src={Logo} alt="logo" />
                </div>
                <div className="FooterTwo"></div>
                <div className="FooterThree"></div>
            </footer>
        </React.Fragment>
    );
}

export default Footer;
